/*------------------------
* 시세_M_아파트
*-------------------------
*/
DROP TABLE TB_PR_M_APT;
 CREATE TABLE TB_PR_M_APT 
(
	TR_GBN	VARCHAR(2)				NOT NULL ,
	BJD_CODE	VARCHAR(10)     NOT NULL ,
	CONTRACT_YMD	VARCHAR(8)  NOT NULL ,
	KAPT_NAME	VARCHAR(50)  NOT NULL ,
	AREA_UNIT	NUMBER(10,2)    NOT NULL ,
	TR_AMT	NUMBER(20)        NULL ,
	DEPOSIT_AMT	NUMBER(20)    NULL ,
	RENT_AMT	NUMBER(20)      NULL ,
	BAT_YM	VARCHAR(6)        NOT NULL ,
	MOD_USER VARCHAR(10)	      NULL ,
	MOD_DATE	DATE DEFAULT     SYSDATE    
);

ALTER TABLE TB_PR_M_APT ADD CONSTRAINT  PK_TB_PR_M_APT PRIMARY KEY (TR_GBN, BJD_CODE, CONTRACT_YMD, KAPT_NAME, AREA_UNIT)  ;
COMMENT ON TABLE TB_PR_M_APT      IS '공통_시세_M_아파트';
COMMENT ON COLUMN TB_PR_M_APT.TR_GBN       IS '거래구분(1.매매/2.전세/3.월세)';
COMMENT ON COLUMN TB_PR_M_APT.BJD_CODE     IS '법정동코드';
COMMENT ON COLUMN TB_PR_M_APT.CONTRACT_YMD IS '계약일자';
COMMENT ON COLUMN TB_PR_M_APT.KAPT_NAME 	 IS '단지명';
COMMENT ON COLUMN TB_PR_M_APT.TR_AMT       IS '매매거래금액(단위:만원)';
COMMENT ON COLUMN TB_PR_M_APT.DEPOSIT_AMT  IS '보증금(단위:만원)';
COMMENT ON COLUMN TB_PR_M_APT.RENT_AMT     IS '월세';
COMMENT ON COLUMN TB_PR_M_APT.AREA_UNIT    IS '면적';
COMMENT ON COLUMN TB_PR_M_APT.BAT_YM       IS '배치조회년월';
COMMENT ON COLUMN TB_PR_M_APT.MOD_USER     IS '수정자'; 
COMMENT ON COLUMN TB_PR_M_APT.MOD_DATE     IS '수정일시'; 


